console.log(localMasterKey,'Is my key')


import connectDB from './db/conn'
require("dotenv").config()


const PORT = process.env.PORT || 8000;
const app = express();

connectDB()


app.use(bodyParser.json())

app.use(
     bodyParser.urlencoded({
    extended: false,
  })
)

app.use(cors())

